if (GRT.hasProcessor('Overlay')) {
    GRT.addProcessor((function(PROCESSOR_ID) {
        var IMG_POPUP_URL_PREFIX = '/auswertung/pix/popup.php/',
            IMG_POPUP_IMG_REGEX = /<img src="([^"]*\/img\/usr\/[^\.]*\.jpg)"/,
            HIDE_DELAY = 150,
            log = null,
            doc = null,
            grt = null,
            assertTrue = null,
            zoomIconProtoype = null,
            xpath = null,
            xhr = null,
            urlCache = {},
            currentThumbId = null,
            currentUsername = null,
            visible = 0,
            urlContainsAll = null,
            HANDLERS = {
                ZOOM_ICON_OVER: function(e) {
                    var o = e.target;
                    if (!o || !/^grtZoom/.test(o.className || '') || !o.id) return;
                    e.cancelBubble = true;
                    currentThumbId = o.id.substring(3);
                    currentUsername = e.target.parentNode.parentNode.parentNode.getAttribute('username') || '';
                    visible = true;
                    findAndLoadFullsizeImge(currentThumbId);
                },
                ZOOM_ICON_OUT: function(e) {
                    if (!/^grtZoom/.test(e.target.className || '')) return;
                    currentThumbId = null;
                    e.cancelBubble = true;
                    visible = false;
                    setTimeout(closeOverlayDelayed, HIDE_DELAY);
                },
                XHR_SUCCESS: function(e) {
                    if (xhr.readyState != 4 || xhr.status != 200) {
                        return;
                    }
                    var html = xhr.responseText || '',
                        imageUrl = extractImageUrlFromImagePopup(html);
                    if (imageUrl) {
                        if (currentThumbId) urlCache[currentThumbId] = imageUrl;
                        showOverlay(imageUrl);
                    } else {
                        hideOverlay();
                    }
                },
                XHR_ERROR: function() {
                    currentThumbId = null;
                    hideOverlay();
                }
            },
            closeOverlayDelayed = function() {
                if (visible) return;
                grt.callAction('closeImageOverlay', {
                    ifNotHovered: true
                });
            },
            closeOverlay = function(force) {
                grt.callAction('closeImageOverlay');
            },
            showOverlay = function(fullsizeImgUrl) {
                grt.callAction('loadImageInOverlay', {
                    url: fullsizeImgUrl,
                    username: currentUsername
                });
            },
            extractImageUrlFromImagePopup = function(html) {
                return (html.match(IMG_POPUP_IMG_REGEX) || [])[1];
            },
            findAndLoadFullsizeImge = function(thumbId) {
                if (urlCache[thumbId]) {
                    currentThumbId = null;
                    showOverlay(urlCache[thumbId]);
                    return;
                }
                if (!xhr) {
                    xhr = new XMLHttpRequest();
                    xhr.addEventListener('load', HANDLERS.XHR_SUCCESS, false);
                    xhr.addEventListener('error', HANDLERS.XHR_ERROR, false);
                }
                currentThumbId = thumbId;
                var imagePopupUrl = IMG_POPUP_URL_PREFIX + thumbId;
                xhr.open('GET', imagePopupUrl, true);
                xhr.send();
            },
            addZoomIcons = function() {
                if (!zoomIconProtoype) {
                    zoomIconProtoype = doc.createElement('i');
                    zoomIconProtoype.className = 'grtZoom';
                }
                var thumbs = doc.getElementsByClassName('thumb'),
                    isClubCenterPage = urlContainsAll('page=club');
                if (!thumbs || !thumbs.length) return;
                for (var i = 0; i < thumbs.length; i++) {
                    var img = thumbs[i],
                        imgParent = img.parentNode,
                        thumbId = null;
                    if (/grtZoomParent/.test(imgParent.className || '')) continue;
                    if (/\/img\/usr\/([0-9a-f]*\.jpg)$/.exec(img.src || '') || /popup\.php\/([0-9a-z\.]+)\.jpg/.exec(imgParent.href || '')) {
                        thumbId = RegExp.$1;
                    }
                    if (!thumbId) return;
                    var icon = zoomIconProtoype.cloneNode(false);
                    icon.id = 'gz_' + thumbId;
                    imgParent.className += ' grtZoomParent';
                    if (isClubCenterPage && imgParent.className.indexOf('pop') >= 0) {
                        icon.className += ' pop';
                    }
                    imgParent.appendChild(icon);
                }
                doc.body.addEventListener('mouseover', HANDLERS.ZOOM_ICON_OVER, true);
                doc.body.addEventListener('mouseout', HANDLERS.ZOOM_ICON_OUT, true);
            },
            init = function(_grt, helpers) {
                if (!helpers.config.z) return;
                grt = _grt;
                log = helpers.log;
                doc = helpers.doc;
                urlContainsAll = helpers.urlContainsAll;
                xpath = helpers.xpath;
                assertTrue = helpers.assertTrue;
                addZoomIcons();
                helpers.addExternalRetriggerHandler(addZoomIcons);
            };
        return {
            ID: PROCESSOR_ID,
            EXCLUSIVE: false,
            NEEDS_DISPATCHER: true,
            CSS: ['imageZoom'],
            init: init
        };
    })('ImageZoom'));
}

