if (GRT.hasProcessor('Profile') || GRT.bodyClassContainsAny('searchResults')) {
    GRT.addProcessor((function(PROCESSOR_ID) {
        var log = null,
            doc = null,
            helpers = null,
            assertTrue = null,
            DONE_MARKER_CLASS = 'grtYTDone',
            REGEX = /(">)?http:\/\/(?:<wbr>)?(?:[a-z]+\.)?(?:<wbr>)?youtube.(<wbr>)?com\/[^\s\t\n\r\]\)"']+/ig,
            THUMB_LOAD_BASE_URL = 'http://ref.noScript.net/ytimg',
            div = 0,
            currentA = null,
            HANDLERS = {
                YT_OVER: function(e) {
                    var a = e.target;
                    if (!(/%3Fv%3D([a-z0-9_\-]*)/i).exec(a.href)) return;
                    div.style.display = 'none';
                    div.childNodes[0].src = THUMB_LOAD_BASE_URL + RegExp.$1;
                    a.style.cursor = 'wait';
                    div.on = 1;
                    currentA = a;
                },
                YT_OUT: function(e) {
                    div.style.display = 'none';
                    div.on = 0;
                },
                YT_MOVE: function(e) {
                    div.style.left = 20 + e.clientX + 'px';
                    div.style.top = 15 + e.clientY + 'px';
                },
                YT_IMG_LOAD: function(e) {
                    if (!div.on) return;
                    div.style.display = 'block';
                    if (currentA) {
                        currentA.style.cursor = 'pointer';
                    }
                },
                YT_IMG_ERROR: function(e) {}
            },
            REPLACE_CALLBACK = function(s) {
                if (!s.indexOf('">')) return s;
                var url = s.replace(/(<wbr>| |<br>?)/g, '').replace('&amp;', '&'),
                    jumpURL = '/jump.php?jump=' + encodeURIComponent(url);
                return '<a class="ytlink" href="' + jumpURL + '" target="_blank">' + s + '</a>';
            },
            markParentTablesDone = function(td) {
                var table = td.parentNode;
                while (table) {
                    if (table.nodeName.toLowerCase() == 'table') {
                        table.className += ' ' + DONE_MARKER_CLASS;
                    }
                    table = table.parentNode;
                }
            },
            processHeadlines = function() {
                if (!helpers.config.yth) return;
                var ytSpans = helpers.xpath('//table[not(contains(@class,"' + DONE_MARKER_CLASS + '"))]//span[contains(.,"http:")][contains(.,"youtube")]'),
                    lastSpan = null;
                for (var i = ytSpans.length - 1; i >= 0; i--) {
                    lastSpan = ytSpans[i];
                    lastSpan.innerHTML = lastSpan.innerHTML.replace(REGEX, REPLACE_CALLBACK);
                }
                if (lastSpan) {
                    markParentTablesDone(lastSpan);
                }
                addYTPreview();
            },
            processProfile = function() {
                if (!helpers.config.ytp) return;
                var PROFILE_XPATH = '//table[contains(@class,"prfl")]/tbody/tr/td[contains(.,"http:")][contains(.,"youtube")]';
                try {
                    var tds = helpers.xpath(PROFILE_XPATH);
                    for (var i = tds.length - 1; i >= 0; i--) {
                        var len = tds[i].innerHTML.length,
                            sDone = tds[i].innerHTML.replace(REGEX, REPLACE_CALLBACK);
                        if (sDone.length == len) continue;
                        tds[i].innerHTML = sDone;
                    }
                    addYTPreview();
                } catch (e) {}
            },
            addYTPreview = function() {
                if (!helpers.config.ytpr) return;
                var ytAs = doc.getElementsByClassName('ytlink');
                if (!ytAs.length) return;
                if (!div) {
                    var tmp = doc.createElement('div');
                    tmp.innerHTML = '<div id="grtYT" style="position:fixed;display:none"><img /></div>';
                    div = tmp.childNodes[0];
                    doc.body.appendChild(div);
                    div.childNodes[0].addEventListener('load', HANDLERS.YT_IMG_LOAD, false);
                    div.childNodes[0].addEventListener('error', HANDLERS.YT_IMG_ERROR, false);
                    div.childNodes[0].style.marginTop = '-33px';
                }
                for (var i = 0; i < ytAs.length; i++) {
                    var a = ytAs[i];
                    a.ytdiv = div;
                    a.addEventListener('mouseover', HANDLERS.YT_OVER, false);
                    a.addEventListener('mouseout', HANDLERS.YT_OUT, false);
                    a.addEventListener('mousemove', HANDLERS.YT_MOVE, false);
                }
            },
            init = function(grt, _helpers) {
                log = _helpers.log;
                doc = _helpers.doc;
                helpers = _helpers;
                assertTrue = _helpers.assertTrue;
                var isResultList = _helpers.bodyClassContainsAny('searchResults');
                if (isResultList) {
                    processHeadlines();
                } else {
                    processProfile();
                }
            };
        return {
            ID: PROCESSOR_ID,
            EXCLUSIVE: false,
            NEEDS_DISPATCHER: true,
            init: init
        };
    })('Youtube'));
}

