if (GRT.hasProcessor('BMIAgeFilter') || GRT.urlContainsAll('&grt_taps_id__')) {
    GRT.addProcessor((function(PROCESSOR_ID) {
        var doc = null,
            log = null,
            helpers = null,
            grt = null,
            TAPSE_CLASS = 'grtTaps',
            TAPSE_ATTRIB = 'grttaps',
            handlerBound = false,
            TAPSE_USER_ID_PARAM = '&grt_taps_id__',
            HANDLERS = {
                TAPSE_CLICK: function(e) {
                    if (!e.target || !e.target.getAttribute(TAPSE_ATTRIB)) return;
                    var tr = e.target.parentNode.parentNode,
                        userId = 0;
                    while (!userId && tr) {
                        if (tr.getAttribute)
                            userId = findUserIdInTR(tr);
                        tr = tr.previousSibling;
                    }
                    if (!userId) {
                        return;
                    }
                    var param = TAPSE_USER_ID_PARAM + userId,
                        tapseUrl = '/auswertung/setcard/romeo/footprint.php?receiverId=' + userId + '&cameFrom=profile' + param;
                    grt.callAction('loadInOverlay', {
                        url: tapseUrl
                    });
                }
            },
            findUserIdInTR = function(tr) {
                if (!tr) return 0;
                var links = helpers.xpath('.//td[contains(@class,"resHeadline")]/a[contains(@href,"/setcard/")]', tr);
                if (links.length) {
                    return (links[0].href.match(/set=(\d*)/) || [])[1] || 0;
                }
                return 0;
            },
            initTapsen = function() {
                var fPrints = helpers.xpath('//img[contains(@src,"/img/footprints/") and not(contains(@class,"' + TAPSE_CLASS + '"))]');
                for (var i = fPrints.length - 1; i >= 0; i--) {
                    var fp = fPrints[i];
                    fp.setAttribute(TAPSE_ATTRIB, 1);
                    fp.className += ' ' + TAPSE_CLASS;
                }
                if (fPrints.length && !handlerBound) {
                    doc.addEventListener('click', HANDLERS.TAPSE_CLICK, true);
                    handlerBound = true;
                }
            },
            getUserIdFromParam = function() {
                var url = location.href;
                return userId = url.substring(url.indexOf(TAPSE_USER_ID_PARAM) + TAPSE_USER_ID_PARAM.length) || '';
            },
            initTapseSubmitPage = function() {
                setTimeout(function() {
                    grt.callAction('closeOverlay');
                }, 10);
            },
            initTapseSelectPage = function() {
                var userId = getUserIdFromParam();
                var as = helpers.doc.getElementsByTagName('a');
                for (var i = 0; i < as.length; i++) {
                    var a = as[i],
                        url = a.href || '',
                        isTapseLink = url.indexOf('saveFootprint.php') >= 0;
                    if (!isTapseLink) continue;
                    a.href = url + TAPSE_USER_ID_PARAM + userId;
                }
            },
            init = function(_grt, _helpers) {
                doc = _helpers.doc;
                log = _helpers.log;
                helpers = _helpers;
                grt = _grt;
                if (!_helpers.config.taps) return;
                if (grt.urlContainsAll(TAPSE_USER_ID_PARAM)) {
                    var isTapseSubmitPage = grt.urlContainsAll('saveFootprint.php'),
                        isTapseSelectPage = !isTapseSubmitPage;
                    if (isTapseSelectPage) {
                        initTapseSelectPage();
                    } else if (isTapseSubmitPage) {
                        initTapseSubmitPage();
                    }
                    return;
                }
                initTapsen();
                _helpers.addExternalRetriggerHandler(initTapsen);
            };
        return {
            ID: PROCESSOR_ID,
            EXCLUSIVE: false,
            NEEDS_DISPATCHER: true,
            CSS: ['tapse'],
            init: init
        };
    })('Tapse'));
}

