// ----------------------- BEGIN: Dispatcher --------------------------------------------------


if (GRT.needsDispatcher()) {
    GRT.setDispatcher((function() {
        var log = null,
            doc = null,
            assertTrue = null,
            initDone = 0,
            actions = {},
            DISPATCH_MSG_NAME = 'GRT_DISPATCH',
            TARGET_ACTION = 'grtTargetAction',
            DOC_ACTIONS_ATTRIB = 'grtactions',
            finalized = false,
            HANDLERS = {
                DISPATCH_MESSAGE_RECEIVED: function(e) {
                    var data = e.data || {},
                        targetAction = data[TARGET_ACTION];
                    assertTrue(!!targetAction, 'Invalid message received: missing action name.');
                    delete data[TARGET_ACTION];
                    callAction(targetAction, data, true);
                }
            },
            cloneFlat = function(obj) {
                var o = obj || {},
                    flatClone = {};
                for (var k in o) {
                    flatClone[k] = '' + o[k];
                }
                return flatClone;
            },
            registeredActionsAttribVal = null,
            registerAction = function(actionName, fn) {
                assertTrue(!finalized, 'Cannot add new action <%s> to finalized Dispatcher.', actionName);
                assertTrue(actionName && fn, 'Invalid actionName or listener for event <%s>', actionName);
                assertTrue(!actions[actionName], 'Action name <%s> already defined.', actionName);
                actions[actionName] = fn;
                registeredActionsAttribVal = (registeredActionsAttribVal || '#') + actionName + '#';
                doc.head.setAttribute(DOC_ACTIONS_ATTRIB, registeredActionsAttribVal);
            },
            docSupportsAction = function(doc, actionName) {
                if (!doc || !doc.head || !doc.head.getAttribute) return false;
                var attrib = doc.head.getAttribute(DOC_ACTIONS_ATTRIB);
                return attrib && attrib.indexOf('#' + actionName + '#') >= 0;
            },
            callAction = function(actionName, actionArgs, noDispatch) {
                var action = actions[actionName];
                if (action) {
                    action.apply(this, [actionArgs]);
                    return;
                }
                if (noDispatch) {
                    return;
                }
                var targetDoc = getDocumentForActionName(actionName, top.document);
                if (!targetDoc) {
                    return;
                }
                dispatchAction(actionName, actionArgs, targetDoc);
            },
            getDocumentForActionName = function(actionName, startDoc) {
                if (!startDoc) {
                    return null;
                }
                var MAX_DEPTH = 5,
                    docsToCheck = [startDoc],
                    depth = 0;
                while (docsToCheck.length && depth < MAX_DEPTH) {
                    if (!depth) {
                        for (var i = 0; i < docsToCheck.length; i++) {
                            if (!docSupportsAction(docsToCheck[i], actionName)) continue;
                            return docsToCheck[i];
                        }
                    }
                    var newDocsToCheck = [];
                    for (var k = docsToCheck.length - 1; k >= 0; k--) {
                        var frames = docsToCheck[k].getElementsByTagName('frame');
                        for (var j = 0; j < frames.length; j++) {
                            var frame = frames[j],
                                doc = frame.contentWindow ? frame.contentWindow.document : frame.contentDocument;
                            if (docSupportsAction(doc, actionName)) {
                                return doc;
                            }
                            newDocsToCheck[newDocsToCheck.length] = doc;
                        }
                    }
                    docsToCheck = newDocsToCheck;
                    depth++;
                }
                return null;
            },
            dispatchAction = function(actionName, actionArgs, targetDoc) {
                assertTrue(!!targetDoc, 'Invalid target document argument');
                var msgData = cloneFlat(actionArgs);
                msgData[TARGET_ACTION] = actionName;
                try {
                    var msgEvent = targetDoc.createEvent('MessageEvent');
                    if (msgEvent.initMessageEvent) {
                        msgEvent.initMessageEvent(DISPATCH_MSG_NAME, false, false, msgData, null, null, null, null);
                    } else {
                        msgEvent = new MessageEvent(DISPATCH_MSG_NAME, {
                            data: msgData
                        });
                    }
                    targetDoc.dispatchEvent(msgEvent);
                } catch (e) {}
            },
            finalize = function() {
                finalized = true;
            },
            init = function(grt, helpers) {
                if (initDone) return;
                log = helpers.log;
                doc = helpers.doc;
                assertTrue = helpers.assertTrue;
                doc.addEventListener(DISPATCH_MSG_NAME, HANDLERS.DISPATCH_MESSAGE_RECEIVED, false);
                grt.callAction = callAction;
                grt.registerAction = registerAction;
                initDone = true;
            };
        return {
            init: init,
            finalize: finalize
        };
    })());
}

